import React, { Component } from 'react'

export default class Userbeaches extends Component {
    render() {
        let userbeachesArr = this.props.userbeaches
        const userBeaches = userbeachesArr.map((userbeach) => {
            return <span key={userbeach.id}>
                <div>
                    {userbeach.name}
                    <button onClick={(userbeach)=>this.props.deleteFromUBs(userbeach)}>Delete from favorites.</button>
                </div>
            </span>


        }
        )
        return (
            <div>Favorite Beaches:
                {userBeaches}
                <button>Return to Beachfinder Mainpage</button>
            </div>
        )
    }
}
